import React, { Fragment } from "react";

import s from "../../styles/video.module.css";

const ChatBox = () => {
    return (
        <Fragment>
            <div className={s.VideoSidebarContinaer}>
                <div className={s.VideoSidebarInnerContinaer}>
                    <h3>
                        Add Logo
                    </h3>
                </div>
            </div>
        </Fragment>
    );
};

export default ChatBox;
